If you could describe 2022 in one word, what would it be?? 👇🏼

I’ll go first, my word is: Unexpected 🤪

From accomplishing things I had only ever dreamed of accomplishing, to immense pain and loss, it has been a year full of great memories, growth, lessons, and restoration. 

As always, thank you to our amazing team at Donadt Dressage for the support along the way - the best grooms, clients, friends, family, coach, owners, vet, farrier, sponsors, and of course the horses. All of which, none of this would be possible without. 💙

Cheers to 2023, I’m going to expect the unexpected 😉

