We’re gearing up and getting ready for the homecoming dressage show at Del Mar Horsepark this week! It’s one of my favorite show venues with so many special memories made there, so I’m very excited it’s up and running again! Thank you @hits_delmar and everyone involved in making it happen! ✨💖

I’ll be bringing my sassy girl, Keira, this time! Training her for competitions has not been our focus, rather mostly just trying to keep her well rounded and entertained! It’s been about a year and a half since she’s shown, so we’re looking forward to another field trip! 🐎 

